webpackJsonp([0xda13ec6eb16b],{5762:function(t,e){t.exports={data:{post:{html:'<p>Despite all the <a href="http://diveintomark.org/archives/2002/10/03.html#when_an_engineer_flaps_his_wings">wailing and gnashing of teeth</a> over the changes in the Google indexing algorithm, I\'m not complaining. I own my blog name. I the one and only <a href="http://www.google.com/search?hl=en&ie=UTF-8&oe=UTF-8&q=PapaScott">PapaScott on Google</a>. And perhaps the entire Internet? Alas, no. Some domain grabber last year registered the domain <a href="http://whois.userland.com/default$papascott.com">papascott.com</a>.  I have no idea why. The registraion expired last month, and I would kind of like to take the domain for myself, but not enough that I\'d pay extra for it or anything.</p>',fields:{title:"papascott.com",date:"09 Oct 2002",url:"https://papascott.de/2002-10-09-papascottcom/"}}},pathContext:{slug:"/2002-10-09-papascottcom/",prev:{fields:{title:"blogrolling.com",date:"09 Oct 2002",slug:"/2002-10-09-blogrollingcom/"}},next:{fields:{title:"Weblogs and your job",date:"10 Oct 2002",slug:"/2002-10-10-weblogs-and-your-job/"}}}}}});
